import React, { useState } from "react";
import { Canvas} from "@react-three/fiber";

import Boxes from './components/Boxes'


function App() {
  const [lists, setList] = useState([
    {
        id: 1,
        color: 'green',
        name: 'Unversitas Terbuka 1',
        link: "https://google.com",
        toggle: true,
    },
    {
        id: 2,
        color: 'Blue',
        name: 'Unversitas Terbuka 2',
        link: "https://facebook.com",
        toggle: true,
    },
    {
        id: 3,
        color: 'blue',
        name: 'Unversitas Terbuka 3',
        link: "https://twitter.com",
        toggle: true,
    },
    {
        id: 4,
        color: 'red',
        name: 'Unversitas Terbuka 4',
        link: "https://twitter.com",
        toggle: true,
    },
    {
        id: 5,
        color: 'red',
        name: 'Unversitas Terbuka 5',
        link: "https://twitter.com",
        toggle: true,
    },
    {
      id: 6,
      color: 'red',
      name: 'Unversitas Terbuka 5',
      link: "https://twitter.com",
      toggle: true,
    },
  ])

  const length = lists.length

  return (
  <>
  <Canvas colorManagement={false} camera={{position: [0,0,10]}}>
    <ambientLight intensity={0.3}/>
    <Boxes lists={lists} lenght={length} />
  </Canvas>
  </>
  );
}

export default App;
